import React, { Component } from "react";

export default class About extends Component{
    constructor(props) {
        super(props);
        this.state = {
          selectedAlg: props.selectedAlg
        };
      }

    render() {
        return (
            <div>{this.state.selectedAlg}</div>
        )
    }
}
